In honor of the booming progress that we have been making over here at DUSTLA, we decided that it was time to treat our supporters with a little gift. Being the first free compilation that we've ever released, we made it a guaranteed fact that it would be filled with the heaviest and most massive tunes you've ever heard. The 'We Are DUSTLA' free compilation album contains a total of 10 different tracks, all fresh to ears across the world. DUSTLA veterans such as ak9, TheBiocide and Shirobon are all involved with this collection as well as new artists in the family including F12, No One Knows, Alex Mind and more. Kill Tonight, an upcoming artist, also makes a debut appearance on this album with his head bangin' track 'Zombie'. The 'We Are DUSTLA' compilation album is bound to break limits and is sure to pop up somewhere in your everyday playlist. Stay tuned for more to come as you can expect numerous bass blasting releases from us and the rest of the DUSTLA dynasty.&#13;
